def bouncing_ball(initial, proportion):
    if initial <= 0 or proportion < 0 or proportion >= 1:
        return -1
    if initial < 2:
        return 0
    height = initial
    bounces = 0
    while height > 1:
        height *= proportion
        bounces += 1
    return bounces

